import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import './index.css';  // Import the global CSS

// Import components
import Home from './components/Home';
import Register from './components/Register';
import Login from './components/Login';
import Profile from './components/Profile';
import NetworkAndUpgrade from './components/NetworkAndUpgrade';
import GiftSystem from './components/GiftSystem';
import SubscriptionMaintenance from './components/SubscriptionMaintenance';
import Support from './components/Support';
import PrivateRoute from './components/PrivateRoute';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/register" element={<Register />} />
          <Route path="/login" element={<Login />} />
          <Route path="/profile" element={<PrivateRoute><Profile /></PrivateRoute>} />
          <Route path="/network" element={<PrivateRoute><NetworkAndUpgrade /></PrivateRoute>} />
          <Route path="/gift-system" element={<PrivateRoute><GiftSystem /></PrivateRoute>} />
          <Route path="/subscription" element={<PrivateRoute><SubscriptionMaintenance /></PrivateRoute>} />
          <Route path="/support" element={<PrivateRoute><Support /></PrivateRoute>} />
        </Routes>
        <ToastContainer />
      </div>
    </Router>
  );
}

export default App;
